while (CONF_GROUP.firstChild) {
    CONF_GROUP.removeChild(CONF_GROUP.firstChild);
}
const BRUSHPANEL = document.createElement("div");
BRUSHPANEL.className = "brush-group";

window._Emitter.off('jul:socketmessage')
window._Emitter.on('jul:socketmessage', (data)=>{
   if(data.type=="brush"){
    console.log(OnBrushClick(data.data));
   }
})

console.log("BrushTools");
CONF_GROUP.appendChild(BRUSHPANEL);
const brush = [
    "paint_1", "paint_2", "paint_3", "paint_4", "paint_5", "paint_6",
    "brush_1", "brush_2", "brush_3", "brush_4", "brush_5", "brush_6",
];
const mode = ["artBrushTool", "paintbrushTool", "smudgeTool"]
async function OnBrushClick(b) {
    let type = "paintbrushTool";
    if (b.includes("paint"))
        type = mode[0];
    else if (b.includes("brush"))
        type = mode[1];
    else if (b.includes("smudge"))
        type = mode[2];


    try {
        bpSync([{
            "_obj": "select",
            "_target": [
                {
                    "_ref": type
                }
            ]
        }, {
            _obj: "select",
            _target: [{
                "_ref": "brush",
                "_name": b
            }]
        }], "brush");
    } catch (error) {
        console.log(error);
    }


}
const chunkbrush = ChunkArray(brush, 6);
for (let i = 0; i < chunkbrush.length; i++) {
    chunkbrush[i].forEach((b, idx) => {4
        const div = document.createElement('div');
        div.className = 'brush-btn';
        div.setAttribute("style", `background-repeat:no-repeat;background-position:-${idx * 50}px -${i * 50}px`);
        div.textContent = b.toUpperCase().replace("_", " ");

        //const div = RF_Panel.add(C.btn, C.class_btn, b.toUpperCase().replace("_", " "));
        div.addEventListener("click", () => OnBrushClick(b))
        BRUSHPANEL.appendChild(div);
    });

}


